import React from "react";
import { Grid } from "@mui/material";
import { DragDropContext, Droppable } from "react-beautiful-dnd";

const Day = () => {
    return (
        <Grid container gap={8} marginTop={'1em'} justifyContent={'center'}>
            <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={550}>
                <DragDropContext>
                    <Droppable droppableId="characters">
                        {(provided) => (
                            <Draggable>
                            {(provided) => (
                              <li key={id}>
                                DragDrop
                              </li>
                            )}
                          </Draggable>
                        )}
                    </Droppable>
                </DragDropContext>
            </Grid>
            <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={550}>

            </Grid>
            <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={550}>

            </Grid>
        </Grid>
    )
}

export default Day;
